import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBIcon,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import CardExample from './event1';
import band from './band.png';
import dance from './music.png';
import comedy from './stage.png';
import beats from './bot.png';
import alumni from './team.png';
import sing from './singer.png';


class Testimonials extends React.Component {
    render() {
        return(
            <MDBContainer >
            <div>
            
     
          
            <h2>Events</h2>
            <br/><br/>
                <MDBRow align="center">
              <MDBCol md="4" lg="4" sm="6"><img src={band} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><img src={alumni} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><img src={sing} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
            
              </MDBRow>
<br/><br/>
              <MDBRow align="center">
              <MDBCol md="4" lg="4" sm="6"><img src={dance} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><img src={beats} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><img src={comedy} alt="" style={{width:"50%",margin:"1rem"}}/></MDBCol>
             
              </MDBRow>
           
                <br/><br/>
            
            </div>
            </MDBContainer>
        );
    }
}

export default Testimonials;
